const DashboardHome = () => {
  return (
    <div className="jumbotron bg-primary text-white">
      <h4 className="my-0">Selamat datang di</h4>
      <h1 className="display-4 my-0">Aplikasi Absensi Online</h1>
      <hr className="my-4" />
      <p className="lead">Aplikasi absensi online berbasis website PT Indoexpress.</p>
    </div>
  );
};

export default DashboardHome;
